  [1104465076]="只要你无事，便是最大的好消息了，宇文珂他已经退走，短时间内应该不会再来杭州了。",
  [1104465077]="我看你欲言又止的样子，想必是想询问宇文珂的事件吧，我看你与他似乎颇有瓜葛。",
  [1104465078]="对，我与他颇有渊源，他之前，并非这样……",
  [1104465079]="【歉意】我对他其实也了解不多，只知道他是教主大人亲自召入教派，并且被委派于白衣使者的重任，主要负责将教主的旨意传递给我们门主。",
  [1104465080]="不过我听闻教主说过，他似乎与当年的宇文庄有莫大的渊源。",
  [1104465081]="【颤抖】宇文庄？是我父母当初的那个宇文庄？",
  [1104465082]="【叹气】不错，当年你的父母，在宇文庄被五绝困于雪山，坠崖失踪，恨我那时并不知晓，单独让你母亲去面对一切，而我什么都未能帮上她。",
  [1104465083]="这些年来，我一直在调查五绝的身份，终于有所眉目！那些陷害你母亲的人，我终究要让他们付出惨重的代价！",
  [1104465084]="【期待】我本来不想把你卷入这漩涡中，但是这些日子，你已经证明了你的能力，因此，我正式向你发出邀请！与我联手，让那些该死的正派，付出应有的代价！",
  [1104465085]="少侠你可算来了。",
  [1104465086]="【严肃】之前说，白衣教的怒吞三山在杭州出现，如今，我收到线人情报，白衣使者——宇文珂如今也在杭州出没。",
  [1104465087]="【喃喃】宇文珂…宇文珂…",
  [1104465088]="要说这宇文珂呀，可真是了不得，年纪轻轻……",
  [1104465089]="【用力抓住】宇文珂他在哪！",
  [1104465090]="【惊吓】少侠，你？",
  [1104465091]="【轻轻握住】冷静，MAINROLE，一切都过去了。",
  [1104465092]="【逐渐冷静】抱歉，刚才失态了，宇文珂在杭州哪里出没，我倒是很想，会，会，他！",
  [1104465093]="根据我的线人情报，宇文珂在武当山的<color=#dd0f0f>武当山道</color>出没，但是他所前往的地方是一片极高的悬崖，若不精通<color=#dd0f0f>腾空术</color>，恐怕难以达到。",
  [1104465094]="腾空术吗……",
  [1104465095]="不过我看少侠你的队伍中，精通腾空术的能人倒是不少，想必那简单的悬崖定然不是你的问题。",
  [1104465096]="既然如此，那官爷等着我的好消息吧！",
  [1104465097]="你还记得开封的<color=#dd0f0f>店小二白玉堂</color>吗？他可是精通腾空术的好手，不如我们找其帮忙吧。",
  [1104465098]="原来如此，灵露，真是多亏了你！",
  [1104465099]="只见跟踪的弟子拐弯抹角，来到了城郊的一个秘密地点。",
  [1104465100]="六扇门弟子",
  [1104465101]="正是踏破铁鞋无觅处，得来全不费工夫！",
  [1104465102]="白衣教弟子",
  [1104465103]="【卸下易容面具】宇文珂大人就在前方了，赶紧把东西交给他吧。",
  [1104465104]="哦？我要的东西，你拿来了吗？",
  [1104465105]="白衣教弟子",
  [1104465106]="禀告宇文珂大人，这就是《华佗青囊书》。",
  [1104465107]="不错，不过你好像还不知道，你被两只小老鼠跟踪了。",
