  [1104465109]="什么！？",
  [1104465110]="【现身】宇文珂，我找你很久了！",
  [1104465111]="【抿嘴】……",
  [1104465112]="【淡淡瞥了一眼】你们两个小家伙，玩够了就早点回去吧，这些事，你们不应该插手的。",
  [1104465113]="说罢，宇文珂转身准备离去。",
  [1104465114]="【愤怒】宇文珂！别走！",
  [1104465115]="月牙村那一晚，为什么！这玉佩对你而言，真的有那么重要吗！",
  [1104465116]="呵，愚蠢的MAINROLE，你还是像以前那么天真，总是会被一些表面的现象所欺骗，直到现在，你还是在不断的重复这样的错误。",
  [1104465117]="你只是一厢情愿的认为，我还是当初的那个好哥哥，但是你知道我这些日子经历了什么吗？人是会变的，也是会伪装的。",
  [1104465118]="这样单纯的你，又有什么资格向我要一个解释呢？",
